import React, { Component } from 'react';

export default class Table extends Component {
    constructor(props) {
        super(props);
        this.state = {
            detail: '',
            itemList: [],
        };
    }

onInputChange = e => {
    this.setState({[e.target.name]: e.target.value});
    //const arr = `${e.target.value}`.replace(/'/ig, "").split("-");
    //var item = arr[0];
    //var price = arr[1];
}

    renderTags =() => {
        if(this.state.tags.length === 0)
            return <p>Please enter input!</p>;
        return   <table> {this.state.tags.map(tag => <tr>
                    <th>{`${this.props.item}`}</th>
                    <th>ID</th>
                    <th>Product</th>
                    <th>Quantity</th>
                    <th>Price</th>
                    <th>Action</th>
                </tr>
            )} </table>
    }


    render() {
        return (

            <div>
                <h1>My Cart</h1>
                    <form>
                        <div className="col-sm-10">
                        <input name="detail" className="form-control" value={this.state.detail}
                               type="text" onChange={(e) => this.onInputChange(e)} />
                        </div>
                    </form>
            </div>

    );
    }
}
